// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title DigitalWatermark
 * @dev Contract for handling digital watermarking operations and verification
 */
contract DigitalWatermark {
    // The main copyright contract address
    address private copyrightContractAddress;
    address private owner;
    
    // Mapping to store watermark verification status
    mapping(bytes32 => bool) private verifiedWatermarks;
    
    // Events
    event WatermarkVerified(bytes32 indexed watermarkHash, bool verified);
    event WatermarkRegistered(bytes32 indexed watermarkHash, string contentId);
    
    // Modifiers
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }
    
    modifier onlyCopyrightContract() {
        require(msg.sender == copyrightContractAddress, "Only copyright contract can call this function");
        _;
    }
    
    // Constructor
    constructor() {
        owner = msg.sender;
    }
    
    /**
     * @dev Set the copyright contract address
     * @param _copyrightContractAddress Address of the copyright contract
     */
    function setCopyrightContractAddress(address _copyrightContractAddress) external onlyOwner {
        copyrightContractAddress = _copyrightContractAddress;
    }
    
    /**
     * @dev Register a watermark hash
     * @param watermarkHash Hash of the watermark
     * @param contentId Identifier for the content (e.g., IPFS hash)
     */
    function registerWatermark(bytes32 watermarkHash, string memory contentId) external onlyCopyrightContract {
        verifiedWatermarks[watermarkHash] = true;
        emit WatermarkRegistered(watermarkHash, contentId);
    }
    
    /**
     * @dev Verify a watermark
     * @param watermarkHash Hash of the watermark to verify
     * @param extractedWatermark The extracted watermark from the content
     * @return Whether the watermark is valid
     */
    function verifyWatermark(bytes32 watermarkHash, string memory extractedWatermark) external returns (bool) {
        // In a real implementation, you would implement more sophisticated verification logic
        // comparing the extracted watermark with on-chain data
        bytes32 extractedHash = keccak256(abi.encodePacked(extractedWatermark));
        bool isValid = (watermarkHash == extractedHash) && verifiedWatermarks[watermarkHash];
        
        emit WatermarkVerified(watermarkHash, isValid);
        return isValid;
    }
    
    /**
     * @dev Generate a watermark key for a content
     * @param contentHash Hash of the content
     * @param owner Address of the content owner
     * @param timestamp Timestamp of the registration
     * @return The generated watermark key
     */
    function generateWatermarkKey(
        string memory contentHash, 
        address owner,
        uint256 timestamp
    ) external pure returns (string memory) {
        // In a real implementation, this would create a more sophisticated watermark
        // For this example, we'll just combine the inputs and return a representation
        return string(
            abi.encodePacked(
                "WM-",
                toHexString(uint256(keccak256(abi.encodePacked(contentHash, owner, timestamp))))
            )
        );
    }
    
    /**
     * @dev Check if a watermark hash is registered
     * @param watermarkHash Hash of the watermark
     * @return Whether the watermark is registered
     */
    function isWatermarkRegistered(bytes32 watermarkHash) external view returns (bool) {
        return verifiedWatermarks[watermarkHash];
    }
    
    /**
     * @dev Convert a uint256 to a hex string
     * @param value The uint256 value
     * @return The hex string representation
     */
    function toHexString(uint256 value) internal pure returns (string memory) {
        if (value == 0) {
            return "0";
        }
        
        bytes memory buffer = new bytes(64);
        uint256 i = 63;
        
        while (value > 0) {
            uint8 remainder = uint8(value % 16);
            if (remainder < 10) {
                buffer[i--] = bytes1(uint8(48 + remainder));
            } else {
                buffer[i--] = bytes1(uint8(87 + remainder)); // 87 = 97 (a) - 10
            }
            value /= 16;
        }
        
        uint256 length = 63 - i;
        bytes memory result = new bytes(length);
        
        for (uint256 j = 0; j < length; j++) {
            result[j] = buffer[i + 1 + j];
        }
        
        return string(result);
    }
}

